css:
.fade {
  color: rgba(157, 165, 180, 0.6);
}
.ink-outline {
  -webkit-user-select: none;
  cursor: default;
  overflow: auto;
  white-space: pre;
  display: flex;
  flex-direction: column;
}
.ink-outline * {
  vertical-align: top;
}
.ink-outline > .outline-header {
  border-bottom: #181a1f 1px solid;
  padding: 5px;
}
.ink-outline > .outline-header .header-main {
  display: flex;
  flex-direction: row;
}
.ink-outline > .outline-header .header-main > * {
  margin: 0 0.5em;
}
.ink-outline > .outline-header .header-main .search-editor {
  flex: 1;
}
.ink-outline > .outline-content {
  overflow: auto;
  height: 100%;
}
.ink-outline > .outline-content table {
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
  width: 100%;
}
.ink-outline > .outline-content table tr.isactive {
  background-color: #3a3f4b;
}
.ink-outline > .outline-content table td {
  padding: 3px 0;
  cursor: pointer;
}
.ink-outline > .outline-content table td.icon {
  text-align: center;
  font-style: normal;
  font-weight: bold;
  width: 2em;
  color: rgba(157, 165, 180, 0.6);
  background: rgba(157, 165, 180, 0.1);
  display: inline-block;
}
.ink-outline > .outline-content table td.icon > *::before {
  position: relative;
  left: 0.2em;
}
.ink-outline > .outline-content table td.icon.attribute {
  color: #d19a66;
  background: rgba(209, 154, 102, 0.2);
}
.ink-outline > .outline-content table td.icon.attribute::before {
  margin: 0;
}
